import React from 'react';

class EmployeeLeft extends React.Component {
    render() {
        let { employees, onClickEmployee } = this.props;

        console.log("load items");
        let employeeList = null;
        if (!!employees) {
            employeeList = employees.map((employee) => (
                <li key={employee.EmployeeID}>
                    <button onClick={() => onClickEmployee(employee.EmployeeID)}>
                    {employee.EmployeeNumber} {employee.FirstName} {employee.LastName}</button>
                </li>
            ));
        }
        return (
            <div>
                {employeeList}
            </div>
        );
    }
}

export { EmployeeLeft }
